import * as React from "react";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import { Button } from "@mui/material";
import HomePageCardImage from "./HomePageCardImage";
import makeStyles from "@mui/styles/makeStyles";

const useStyles = makeStyles((theme) => ({
  title: {
    position: "relative",
    maxWidth: "240px",
    height: "21px",
    marginLeft: "15px",
    marginTop: "10px",
    lineHeight: "21px",
    fontSize: "18px",
  },
  body: { position: "relative",
  maxWidth: "240px",
  height: "17px",
  marginLeft: "15px",
  marginTop: "5px",
  lineHeight: "17px",
  fontSize: "14px",},
  button:{position: "absolute",
  background: 0,
  textTransform: "none",
  height: "100px",
  width: "270px",
  marginTop: "-40px",
  marginLeft: "-10px",},
  inspectText:{textDecoration: "underline",
  lineHeight: "17px",
  fontSize: "16px",
  marginTop: "55px",
  marginLeft: "-190px",}
}));

export default function HomePageCard({
  title,
  body,
  img,
  cardLink,
  width,
  height,
}) {
  const classes = useStyles();

  return (
    <Card sx={{ width: width, height: height }} elevation={1}>
      <CardContent style={{ padding: 0 }}>
        <HomePageCardImage image={img} />

        <Typography
          variant="subtitle1"
          className={classes.title}
        >
          {title}
        </Typography>

        <Typography
          variant="body1"
          className={classes.body}
        >
          {body}
        </Typography>
      </CardContent>

      <CardActions>
        <Button
          disableRipple={true}
          href={cardLink}
          className={classes.button}
        >
          <Typography
            className={classes.inspectText}
            color="secondary"
          >
            Incele
          </Typography>
        </Button>
      </CardActions>
    </Card>
  );
}
